import React, { Component } from 'react';
import HomePage from "./Counter";


export class Home extends Component {
  static displayName = Home.name;



  render () {
    return (
      <div>
        <BrowserRouter>
          <Switch>
            <Route exact path="/HomePage" component={HomePage} />
          </Switch>
        </BrowserRouter>,
      </div>
    );
  }
}
